import {BrowserRouter as Router,Route,} from 'react-router-dom';
import HomePage from './HomePage.jsx';
import Test from './Test.jsx'
function App(){
	return(
		<Router>
		<div>
			<Route exact path="/" component={HomePage}/>
			<Route path="/test" render={() =>{latest.map((x) => (
          <Test img={x.img} price={x.price}  location={x.location} bed={x.bed} bath={x.bath} size={x.size} />
        ))}}/>		
		</div>
		</Router>
		);
		
}

export default App;
